@Component({
    selector: 'app-root', // Angular component selector
    templateUrl: 'app.component.html',  // HTML template file for the component
    styleUrls: ['app.component.css'],
    encapsulation: ViewEncapsulation.None,  // No view encapsulation
    standalone: true,  // Indicates it's a standalone component
    imports: [ DiagramModule, NumericTextBoxModule, ButtonModule, ]  // Importing necessary Angular modules and components
})

